import React from 'react' ;
import './Matches.css';


function Matches()  {

    const [san , setSan ]= useState(false) ;
    const [sentiage , setSentiage ]= useState(false) ;
    const [star , setStar ]= useState(false) ;
    const [elshrouk , setElshrouk ]= useState(false) ;

    return(
    <div className="matches">
    <button onClick={ ()=>setSan(!san)     }   className="court-name">
              san siro
              </button>

              <button onClick={ ()=>setSentiage(!sentiage)     }  className="court-name" >
              Sentiago
              </button>

              <button onClick= {()=> setStar(!star)     }   className="court-name" >
                Star Park
              </button>
              
              <button onClick={ ()=>setElshrouk(!elshrouk)     }   className="court-name">
              Elsherouk
              </button>
      
    </div>

    );
}
  export default Matches ;
